`DurbinMA1` <-
function(z, p){
phis<-c(1, -(ar.burg(z,aic=FALSE, order.max=p)$ar))
p1<-length(phis)
sum(phis[1:(p1-1)]*phis[2:p1])/sum(phis^2)
}

