`SDRelativeEfficiency` <-
function(x,y){
mx<-mean(x)
my<-mean(y)
sx<-mean((x-mx)^2)
sy<-mean((y-my)^2)
sxy<-mean((x-mx)*(y-my))
v<-(sx/(my^2)) + (sy*mx^2)/(my^4) - (2*sxy*mx)/(my^3)
sqrt(v/length(x))
}

`SimulateMA1` <-
function(n, theta){
a<-rnorm(n+1)
a[2:(n+1)]-theta*a[1:n]
}

